import "../css/styles.css";

const MyApp = ({Component, pageProps}) => {
    return (
        <div className = "container">
            <div className = "bg-gray-200 p-4">
                PalpiteBox
            </div>
            <Component {...pageProps} />
        </div>
    )
};

export default MyApp;
